import React, { useState, useCallback } from 'react';
import { Upload, Info, RefreshCw } from 'lucide-react';
import { motion } from 'framer-motion';
import GradCAMVisualization from '../components/classification/GradCAMVisualization';
import { classifyImage } from '../utils/api';
import { Alert, AlertDescription } from '@/components/ui/alert';
import { Card, CardContent, CardHeader, CardTitle } from '@/components/ui/card';

const ClassificationPage = () => {
  // State management
  const [selectedImage, setSelectedImage] = useState(null);
  const [prediction, setPrediction] = useState(null);
  const [isLoading, setIsLoading] = useState(false);
  const [selectedModel, setSelectedModel] = useState('mobilenet_v3');
  const [error, setError] = useState(null);
  const [uploadProgress, setUploadProgress] = useState(0);

  // Available models configuration
  const models = [
    { 
      value: 'mobilenet_v3', 
      label: 'MobileNet V3', 
      description: 'Lightweight and fast, ideal for mobile devices.' 
    },
    { 
      value: 'efficientnet_b0', 
      label: 'EfficientNet B0', 
      description: 'Balanced accuracy and efficiency.' 
    },
    { 
      value: 'resnet18', 
      label: 'ResNet 18', 
      description: 'Deep residual learning for image recognition.' 
    },
    { 
      value: 'resnet50', 
      label: 'ResNet 50', 
      description: 'Improved accuracy with deeper architecture.' 
    },
    { 
      value: 'squeezenet1_1', 
      label: 'SqueezeNet', 
      description: 'Compact model with minimal parameters.' 
    },
    { 
      value: 'mobilevit', 
      label: 'MobileViT', 
      description: 'Combines CNNs and Transformers for mobile devices.' 
    },
  ];

  // Handle file validation
  const validateFile = (file) => {
    const validTypes = ['image/jpeg', 'image/png', 'image/bmp', 'image/tiff'];
    if (!validTypes.includes(file.type)) {
      throw new Error('Please upload a valid image file (JPEG, PNG, BMP, or TIFF)');
    }
    if (file.size > 10 * 1024 * 1024) {
      throw new Error('File size should be less than 10MB');
    }
    return true;
  };

  // Handle image upload
  const handleImageUpload = async (event) => {
    const file = event.target.files[0];
    if (!file) return;

    try {
      validateFile(file);
      
      setSelectedImage(URL.createObjectURL(file));
      setIsLoading(true);
      setError(null);
      setUploadProgress(0);
      setPrediction(null);

      // Simulate upload progress
      const progressInterval = setInterval(() => {
        setUploadProgress(prev => Math.min(prev + 10, 90));
      }, 100);

      const result = await classifyImage(file, selectedModel);
      
      clearInterval(progressInterval);
      setUploadProgress(100);
      setPrediction(result);

    } catch (error) {
      console.error('Error:', error);
      setError(error.message || 'Error processing image');
      setSelectedImage(null);
    } finally {
      setIsLoading(false);
    }
  };

  // Handle drag and drop
  const handleDragOver = (e) => {
    e.preventDefault();
    e.stopPropagation();
  };

  const handleDrop = useCallback((e) => {
    e.preventDefault();
    e.stopPropagation();
    
    const file = e.dataTransfer.files[0];
    if (file) {
      const input = document.createElement('input');
      input.files = e.dataTransfer.files;
      handleImageUpload({ target: input });
    }
  }, []);

  // Reset all states
  const handleReset = () => {
    setSelectedImage(null);
    setPrediction(null);
    setError(null);
    setUploadProgress(0);
  };

  return (
    <div className="min-h-screen bg-gradient-to-r from-blue-100 to-blue-50">
      <div className="max-w-6xl mx-auto p-6">
        <Card className="mb-8">
          <CardHeader>
            <CardTitle className="text-3xl font-bold text-center text-blue-900">
              OCT Image Classification
            </CardTitle>
          </CardHeader>
          <CardContent>
            {/* Model Selection */}
            <div className="mb-6">
              <label className="block text-gray-700 font-semibold mb-2">
                Select Model
              </label>
              <select
                value={selectedModel}
                onChange={(e) => setSelectedModel(e.target.value)}
                className="w-full p-3 border rounded-lg bg-white shadow-sm focus:ring-2 focus:ring-blue-500"
              >
                {models.map((model) => (
                  <option key={model.value} value={model.value}>
                    {model.label}
                  </option>
                ))}
              </select>
              <p className="text-sm text-gray-600 mt-2">
                {models.find((m) => m.value === selectedModel)?.description}
              </p>
            </div>

            {/* Upload Area */}
            <div 
              className="border-2 border-dashed border-blue-300 rounded-lg p-8 text-center bg-white hover:border-blue-500 transition-colors duration-200"
              onDragOver={handleDragOver}
              onDrop={handleDrop}
            >
              <input
                type="file"
                accept="image/*"
                onChange={handleImageUpload}
                className="hidden"
                id="image-upload"
              />
              <label 
                htmlFor="image-upload" 
                className="cursor-pointer block"
              >
                <Upload className="mx-auto h-12 w-12 text-blue-500 mb-3" />
                <p className="text-lg font-semibold text-blue-700 mb-2">
                  Click or drag image to upload
                </p>
                <p className="text-sm text-gray-500">
                  Supports JPEG, PNG, BMP, TIFF (max 10MB)
                </p>
              </label>
            </div>

            {/* Error Message */}
            {error && (
              <Alert variant="destructive" className="mt-4">
                <AlertDescription>{error}</AlertDescription>
              </Alert>
            )}

            {/* Upload Progress */}
            {isLoading && uploadProgress < 100 && (
              <div className="mt-4">
                <div className="h-2 bg-blue-100 rounded-full overflow-hidden">
                  <div 
                    className="h-full bg-blue-500 transition-all duration-300"
                    style={{ width: `${uploadProgress}%` }}
                  />
                </div>
                <p className="text-sm text-gray-600 mt-2 text-center">
                  Processing image... {uploadProgress}%
                </p>
              </div>
            )}

            {/* Results Section */}
            {selectedImage && !isLoading && (
              <motion.div
                className="grid md:grid-cols-2 gap-6 mt-6"
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.5 }}
              >
                {/* Original Image */}
                <Card>
                  <CardHeader>
                    <CardTitle className="text-lg">Original Image</CardTitle>
                  </CardHeader>
                  <CardContent>
                    <img
                      src={selectedImage}
                      alt="Uploaded OCT"
                      className="w-full h-64 object-contain rounded-lg border border-gray-200"
                    />
                  </CardContent>
                </Card>

                {/* Prediction Results */}
                {prediction && (
                  <Card>
                    <CardHeader>
                      <CardTitle className="text-lg">Analysis Results</CardTitle>
                    </CardHeader>
                    <CardContent>
                      <div className="space-y-4">
                        <div>
                          <p className="text-sm font-medium text-gray-500">Condition</p>
                          <p className="text-lg font-semibold text-blue-900">
                            {prediction.class}
                          </p>
                        </div>
                        
                        <div>
                          <p className="text-sm font-medium text-gray-500">Confidence</p>
                          <p className="text-lg font-semibold text-blue-900">
                            {(prediction.confidence * 100).toFixed(1)}%
                          </p>
                        </div>

                        {/* GradCAM Visualization */}
                        <GradCAMVisualization 
                          gradcam={prediction.gradcam}
                          isLoading={isLoading}
                        />
                      </div>
                    </CardContent>
                  </Card>
                )}
              </motion.div>
            )}

            {/* Reset Button */}
            {selectedImage && !isLoading && (
              <div className="text-center mt-6">
                <button
                  onClick={handleReset}
                  className="bg-gray-600 hover:bg-gray-700 text-white px-6 py-2 rounded-lg flex items-center justify-center mx-auto transition-colors duration-200"
                >
                  <RefreshCw className="mr-2 h-4 w-4" />
                  Reset
                </button>
              </div>
            )}
          </CardContent>
        </Card>
      </div>
    </div>
  );
};

export default ClassificationPage;
